import React from "react";
import { MDBBtn, MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem } from "mdbreact";
import "../styles/RouterPanel.css";

const SimulationOptions = props => {
  const IntruderWifi = () => {
    return (
        <MDBDropdown>
        <MDBDropdownToggle style={buttonStyle} caret color="default">
          Type
        </MDBDropdownToggle>
        <MDBDropdownMenu basic>
          <MDBDropdownItem>{props.truckTypes[0]}</MDBDropdownItem>
          <MDBDropdownItem>{props.truckTypes[2]}</MDBDropdownItem>
          <MDBDropdownItem>{props.truckTypes[1]}</MDBDropdownItem>
        </MDBDropdownMenu>
      </MDBDropdown>
    );
  };
  return (
    <div>
      <MDBBtn color="deep-purple" onClick={() => props.toogleShowRadius()}>
        Wifi Ranges
      </MDBBtn>
      <MDBBtn color="deep-purple" onClick={() => props.toogleIntruder()}>
        Intruder
      </MDBBtn>
      <IntruderWifi />
    </div>
  );
};

export default SimulationOptions;
